class Solution {
public:
    int maxProductDP( int A[], int n) {
        int maxp = 0;
        vector<int> pros;
        for ( int i = 0; i < n; i ++) {
            pros.push_back(A[i]);
            maxp = max(pros.back(), maxp);
        }
        for ( int i = 1; i < n; i ++) {
            for ( int j = 0; (i + j) < n; j ++) {
                pros[j] = pros[j+1] * A[j];
                maxp = max(pros[j], maxp);
            }
        }
        return maxp;
    }
    int maxProduct( int A[], int n) {
        int maxv = 0;
        int maxp = A[0], minp = A[0];
        for ( int i = 1; i < n; i ++) {
            int tmpmax = max(maxp*A[i], minp*A[i]);
            tmpmax = max(tmpmax, A[i]);
            int tmpmin = min(maxp*A[i], minp*A[i]);
            tmpmin = min(tmpmin, A[i]);
            maxp = tmpmax;
            minp = tmpmin;
            maxv = max(maxv, maxp);
        }
        return maxv;
    }
};

